const graphql = require('graphql');

const _=require('lodash')
const { GraphQLObjectType, GraphQLString, GraphQLSchema } = graphql;
//dummy data
var usersdata= [
    {id:'1',name:'root',pass:'12345',acsseskey:'qwerty'}
]

var animaldata=[{
    id:'1',
    species:'lino',
    info:'   more stuf  ',
    img:'data:image/jpeg;base64,'
},
{id:'2',
    species:'rino',
    info:'   more stuf  ',
    img:'data:image/webp;base64,'
}
]



//user 
const UserType= new GraphQLObjectType({
    name: 'user',
    fields:()=>({
        id:{type: GraphQLString},
        pass:{type: GraphQLString},
        name:{type: GraphQLString},
        acsseskey:{type: GraphQLString}
    })
});

//animals

const AnimalType= new GraphQLObjectType({
    name: 'animal',
    fields:()=>({
        id:{type: GraphQLString},
        species:{type: GraphQLString},
        info:{type: GraphQLString},
        img:{type: GraphQLString}
    })
});

const RootQuery= new GraphQLObjectType({
   name:'RootQueryType',
   fields:{
       user:{
           type:UserType,
           args:{
                name:{type: GraphQLString},
                pass:{type: GraphQLString
               }
           },
           resolve(parent,args ){
               var a= _.find(usersdata,{name:args.name })
               if (a.pass==args.pass)
                return a
               
           }

       },
       animal:{
        type:AnimalType,
        args:{
             img:{type: GraphQLString},
             acsseskey:{type: GraphQLString}
        },
        resolve(parent,args ){
            a =_.find(usersdata,{acsseskey:args.acsseskey })
            if (a!=null){
            const newLocal = animaldata[0];
            return newLocal;
            }
            return null;
        }
       }
   }
})

module.exports = new GraphQLSchema({
    query: RootQuery
});